query MoreInfoTestsQuery {
  show(id: "anderson-fine-art-gallery-flickinger-collection") {
    ...MoreInfo_show
    __id
  }
}

fragment MoreInfo_show on Show {
  __id
  id
  partner {
    __typename
    ... on Partner {
      website
      type
    }
    ... on Node {
      __id
    }
    ... on ExternalPartner {
      __id
    }
  }
  press_release
  events {
    ...EventSection_event
  }
}

fragment EventSection_event on PartnerShowEventType {
  event_type
  description
  start_at
  end_at
}
